3900,'Smartwatch Huawei Watch Fit Negro',2000,'Con una magnífica pantalla AMOLED rectangular de 1,64 pulgadas y una resolución HD de 280 x 456, 2 HUAWEI WATCH FIT ofrece una experiencia de visualización amplia y ultra clara. El ajuste de brillo automático ofrece una mejor visualización a la luz del sol, mientras que las seis esferas del reloj Always-On3 le permiten expresar su estilo y estado de ánimo personal en un día determinado',_binary 'smartwatch.jpg','2',2,18,NULL,NULL,NULL,1283205551,'2021-03-17',NULL),(1077648577,'Volkswagen T-Cross',444610,'Importada desde Brasil, la T-Cross se monta sobre la arquitectura MQB A0, que es compartida con Virtus. Uno de sus puntos fuertes es su gran habitabilidad y una generosa zona de carga de 420 litros. Bajo el cofre se encuentra el conocido 1.6 L MSI que puede hacer mancuerna con una caja manual o automática Tiptronic. En las pruebas de impacto de Latin-NCAP obtuvo una calificación de cinco estrellas.',_binary 'T-Cross.jpg','1',4,4,NULL,NULL,NULL,1695507242,'2021-03-17',NULL),(1095439284,'Casa Res.Gualiqueme',8701200,'asa de 4 habitaciones ubicada frente a carretera panamericana ubicada dentro de increíble terreno de mas de 8000v2.  Área de terreno: 8,000v2 Área de construcción: 266.50 m2  Es de un nivel con fácil acceso a la vías de circulación que van al centro y fuera de la ciudad, Con los servicios públicos de energía, agua de pozo, alumbrado publico, tren de aseo, fosa séptica.  Caseta de vigilancia, acceso vehicular empedrado, porch techado, acceso techado, estacionamiento techado, lavanderia techada, dormitorio de servicio con su baño completo, bodega, terraza techada, pasillos de circulación abierto, sala de estar, comedor, cocina, desayunador, dormitorio de visitas con su baño completo, dos (2) dormitorios con su baño completo, dormitorio principal con su baño completo y walking closet, bodega aislada con un (l) medio baño.',_binary 'casa12.jpg','1',7,3,'','','',1695507242,'2021-03-19',NULL),(1127614873,'Ford Edge',789900,'Respuesta directa a modelos como Nissan Murano, Hyundai Santa Fe y Jeep Cherokee, la Edge se presenta como una SUV/Crossover mediana con un perfil no del todo familiar, ya que solo cuenta con una capacidad de cinco pasajeros. De hecho, su vocación deportiva queda claro con la variante Sport que es impulsada por un V6 de 2.7L Turbo EcoBoost con 315 caballos. Las versiones más comunes, recurren a un más eficiente cuatro cilindros de 2.0 Litros turbocargado con 245 caballos de fuerza. Como sea, la transmisión siempre es una automática de seis velocidades con paletas de cambio al volante.',_binary 'edge.jpg','1',4,15,NULL,NULL,NULL,1695507242,'2021-03-20',NULL),(1162658036,'Casa en Condominio,Lomas del Guijarro',7371850,'Circuito Cerrado de 8 townhouses y área de juegos común • 3 niveles, 3 habitaciones, 2.5 baños, sala de tv • Habitacion principal con walk-in closet y baño propio. • Sala Comedor, cocina abierta con isla y top de cuarzo, • Guest/Game Room con baño completo apto para home office • Terraza amplia con área para barbacoa con medio baño • Cuarto de empleada, bodega y lavanderia • 2 estacionamientos • Todos los baños con griferia de lujo, • Excelente iluminación y ventilación natural en toda la casa.',_binary 'casa4.jpg','1',7,0,'','','',1695507242,'2021-03-21',NULL),(1206762452,'Casa Vacacional La Ensenada',8942900,'Linda casa vacacional con vista hacia la playa. Ubicada en La Ensenada en Tela.  La casa consta de dos pisos. En su primera planta tiene comedor, cocina, 2 salas, porsche, cuarto de empleada y estacionamiento. En el segundo nivel consta de 4 habitaciones, 3 baños completos, sala familiar y terraza',_binary 'casa20.jpg','2',7,11,'','','',1881926058,'2021-03-22',NULL),(1209257036,'Audifonos de Diadema On Ear Sony',395,'Los controladores de neodimio dinámicos proporcionan un sonido preciso  Gracias a las ligeras unidades de diafragma de neodimio dinámico de 30 mm, los auriculares ofrecen una respuesta potente y rítmica incluso con las pistas más exigentes. Combínalas con  El diseño plegable giratorio te permite viajar con facilidad  Llévate estos auriculares contigo donde vayas. El diseño giratorio de los auriculares te permite guardarlos de manera correcta.',_binary 'audifonos.jpg','1',2,8,NULL,NULL,NULL,1881926058,'2021-03-23',NULL),(1298391439,'Casa Col. La Campaña',2417000,'Amplia casa ubicada en Circuito Cerrado Consta de 2 niveles 2ndo nivel: habitación principal, con su baño privado, su sala pequeña y terraza, además acceso independiente. Habitaciones secundarias amplias que comparten baño. Otra secundaria con pequeña terraza y closet, tiene su baño afuera de la habitación. 1er nivel: sala, comedor, cocina, estudio, cuarto de empleada, área social y jardín. Estacionamiento para 1 vehículo y bodega pequeña La casa esta en circuito cerrado por lo cual pueden dejar vehículos afuera.',_binary 'casa8.jpg','2',7,1,'','','',1881926058,'2021-03-24',5),(1531951138,'Laptop Dell Inspiron 15\" Intel Core i3',16500,'Laptop de 15 pulgadas que ofrece un rendimiento con capacidad de respuesta en un diseño elegante con bordes angostos de dos lados, ExpressCharge, y procesadores Intel Core.Cap. Disco Duro (5400 RPM) GB - 1 TB',_binary 'LaptopDell.jpg','1',2,15,NULL,NULL,NULL,1881926058,'2021-03-24',NULL),(1607775862,'Vestido denim cut out',1095,'Color: Azul claro  Care for fiber: al menos 15% algodón reciclado. La producción de esta fibra recupera residuo de algodón, principalmente de la producción de otras prendas de algodón, reduciendo así la producción de materia prima virgen y el consumo de agua, energía y recursos naturales.',_binary 'vestido3.jpg','1',9,3,'','','',1901400232,'2021-03-25',NULL),(1680274885,'Jeans patchwork pastel two-tone',1095,'Talla del modelo: 40  Altura del modelo: 185 cm  Color: Beige  Care for fiber: al menos 50% algodón orgánico. Algodón cultivado utilizando fertilizantes y pesticidas naturales. Además, en su cultivo no se utilizan semillas modificadas genéticamente, lo que ayuda a 