 Tiene una sala grande, cocina, comedor, sala de juegos, garaje, bodega, 5 habitaciones tipo “Suite” con sus respectivos baños, habitación principal con baño amplio e jacuzzi, un medio baño para visitas, chimenea, corredores y terrazas, candelabros todos de la misma familia importados (Home Depot), calentador de agua central.',_binary 'casa16.jpg','2',7,2,'','','',1695507242,'2021-03-28',NULL),(2014043122,'Servicios de Reparacion',500,'Reparacion de Celulares.No incluye Costos adicionales.',_binary 'reparacion.jpg','3',6,4,NULL,NULL,NULL,1695507242,'2021-03-29',NULL),(2059976625,'Honda City',359091,'La quinta generación del Honda City ahora nos llega de la India (no de China), posee una apariencia distinta, con mejor equipamiento de confort y de seguridad. Ofrece un nuevo diseño bastante conservador, pero que no deja de ser atractivo, pues luce como si fuera un pequeño Civic Por el diseño es igual de conservador que el del exterior, pero conserva la calidad de la marca. Bajo el cofre no hay novedades, emplea el mismo bloque del modelo anterior.',_binary 'hondaCity.jpg','1',4,2,NULL,NULL,NULL,1695507242,'2021-03-30',NULL),(2082270687,'Juego De Sala Berlin 3-1-1',10990,'Diseño clasico 3-1-1/ Fabricado con telas importadas: Suede / Incluye 4 cojines decorativos / Base de madera de pino curada / Patas plasticas de 3 pulgadas / Botones decorativos en respaldar / Espuma de alta densidad en asientos y respaldos ',_binary 'muebles.png','1',1,3,NULL,NULL,NULL,768907826,'2021-04-01',NULL),(2084625924,'Volkswagen T-Cross',444610,'Importada desde Brasil, la T-Cross se monta sobre la arquitectura MQB A0, que es compartida con Virtus. Uno de sus puntos fuertes es su gran habitabilidad y una generosa zona de carga de 420 litros. Bajo el cofre se encuentra el conocido 1.6 L MSI que puede hacer mancuerna con una caja manual o automática Tiptronic. En las pruebas de impacto de Latin-NCAP obtuvo una calificación de cinco estrellas.',_binary 'T-Cross.jpg','1',4,4,NULL,NULL,NULL,1226886